import React from 'react'
import { css, jsx } from '@emotion/react'

export const Slide = ({ content }) => (
  <div
    css={css`
      height: 100;
      width: 100;
      background-image: url('${content}');
      background-size: cover;
      background-repeat: no-repeat;
      background-position: center;
    `}
    {...props}
  />
)
